import React from "react";
import { Link } from "react-router-dom";

const Footer = ({nowTopic}) =>{
    let update, remove = null;

    if(nowTopic !== "Main"){
        update = <Link to='/update'><button>Update</button></Link>
        remove =  <button onClick={onDelete}>Delete</button>
    }

    return(
        <footer>
            <Link to='/create'><button>Create</button></Link>
            {update}
            {remove}
        </footer>
    );
}

export default Footer;
